const tab = [
{Question : "question1", Reponse : "reponse1"}, 
{Question : "question2", Reponse : "reponse2"}, 
{Question : "question3", Reponse : "reponse3"}
]


function Quedestion({value}) {
    return (
    <h1 className="questiontext">
        {value}
    </h1>
    );
}

function Random() {
    return (
        Math.floor(Math.random()*(tab.length))
    );
}

function Question() {
    return (
        <button onClick={() => console.log(Math.floor(Math.random()*(tab.length))) } >TEST </button>
    );
}

export default Question
